description:
Дуже гарна і автономна настільна лампа, в наявності також ще магнітна лампа. Лампа нова в заводських пломбах.
Самовивіз м лівобережна або Олх доставка.

Завдяки компактному корпусу та складаній конструкції лампа займає мало місця, а вбудований акумулятор дає змогу використовувати пристрій тривалий час далеко від джерела живлення.

Особливості:
лампа має інтелектуальне визначення довкілля та регулює світло залежно від переважальних умов;
плавне регулювання яскравості та 3 режими освітлення;
ємний акумулятор і порт USB-C для швидкого заряджання або стаціонарної роботи;
батареї вистачає на 12 годин роботи;
двошарова фільтрація захищає очі та запобігає втомі після тривалого використання;
можна використовувати будь-який USB-порт комп'ютера, ноутбука або Power Bank для заряджання;
світильник має вогнестійкий корпус класу В, безпечніший і надійний.
Модель обладнана сучасними функціями, як-от інтелектуальне розпізнавання довкілля та можливість автоматичного вибору яскравості — завдяки цьому ви знайдете ідеальне світло в будь-якій ситуації. Це зручно, наприклад, для вечірнього читання: з настанням темряви світло поступово стає яскравішим, не даючи очам втомлюватися. Саме освітлення максимально природне та не спотворює кольори предметів. Якщо ж вимкнути інтелектуальну функцію, то можна вручну вибрати світло з доступних 3 режимів (холодне світло — 6000К, нейтральне світло — 4000K, тепле світло — 3000 К). Плавне регулювання яскравості доступне в кожному з режимів.

Акумулятор ємністю 2200 мА·год означає, що лампу не потрібно постійно під'єднувати до джерела живлення. Вона може працювати 3 години за максимального освітлення й понад 12 годин за слабкого освітлення. Отже, ви можете носити лампу із собою по дому та не відчувати прихильності до одного місця. Лампа заряджається через USB-кабель, ззаду є роз'єм USB-C. Час заряджання 1,5 години.

Безпека. Навіть найкращі окуляри не краще за гарне світло. Освітлення не небезпечне синім світлом, має візуальний стробоскопічний ефект і забезпечує кращий захист очей. Лампа пройшла міжнародну сертифікацію, завдяки якій захистить ваші очі здоровим джерелом світла.

Виготовлення. Крім функціональності, світильник вирізняється ще й стильним дизайном. Завдяки мінімалістичному дизайну він підійде до будь-якого інтер'єру, не займе багато місця. Лампа розміщена на масивній металевій підставці з акумулятором і блоком керування. Панель обладнана датчиком освітленості та сенсорною кнопкою для перемикання режимів. Під ним розміщений інтелектуальний перемикач режимів і протиковзне зусилля, , щоб лампа не ковзала по гладкому столу.

Саме освітлення широке та містить 32 світлодіоди. Алюмінієвий корпус добре справляється з поглинанням надлишкового тепла, що виділяється світлодіодними стрічками. Складана конструкція моделі робить її дуже компактною та зручною для перенесення. У складеному вигляді займає обмаль місця. Лампа має зручну систему регулювання в діапазоні 180 градусів, що дає нам виставити світло під найзручнішим для нас кутом.

Технічні характеристики:
Виготовлений з: АБС + ПК + алюміній;
Ємність: 2200 мА·год;
Колір світла: 3000 К, 4000 К, 6000 К;
Розмір: 290 x 350/75 (освітлення/основа основа) x 45 мм;
Вага продукту: 550 г;
Номінальна напруга: 5 В;
Потужність: 5 Вт;
Тип світла: LED;
Індекс передавання кольору: нижче ніж 95 Ra;
Кількість світлових точок: 32;
Заряджання: кабель USB-C (у комплекті).

Продаю стільці - всього 10 шт.
Продаю як по одному, так все цілком.
В хорошу стані, майже нові;
Самовивіз;
Ст.м.Харківська , вул.Вишняківська

Диспенсер для бумажных полотенец

Настенный диспенсер для пленки и бумажных полотенец Parat Plus дает вам быстрый доступ ко всему, что вам нужно:

- Два закрытых контейнера могут содержать алюминиевую фольгу и пищевую фольгу.
- для пакетов предусмотрено одно отделение для хранения.
- Кроме того, продукт содержит держатель клейкой ленты и отделение для мелких предметов.
- держатель – для подвешивания бумажного полотенца.

Настенный диспенсер для бумажных полотенец и фольги Parat Plus оснащен специальными лезвиями, точно режущими пленку и алюминиевую фольгу. Никаких неровных, зазубренных краев и никаких переборов пищевой пленки, чтобы найти ее конец. После обрезки концы фольги достаточно торчать из кормушки, чтобы в следующий раз вытащить их. Очень острые ножи скрыты за практичными режущими ползунками, чтобы защитить пальцы от порезов. Подающие ролики легко устанавливаются на стене, их можно быстро и удобно вставить спереди. Просто снимите крышку, вставьте рулоны и Parat Plus готов к работе.

!! Подходить для рулонов всех стандартных размеров на рынке!!
Подходят рулоны бумаги до 60м, рулоны фольги и пленки до 30м.

Диспенсер для бумажных полотенец, характеристики:

Высота: 31,5 см;
Ширина: 38,5 см;
глубина: 7 см;
Маретиал: пластик;
Цвет: белый;

Надежная подача фольги и бумаги с местом для алюминиевой фольги и пищевой фольги, бумажных полотенец и пакеты для замораживания;
Он также имеет дозатор для клейкой ленты и хранение мелких предметов;
Специальный нож обеспечивает точно разрезанную пленку;
Устройство подачи крепиться к стене с помощью шурупов;

Органайзер для полотенец, комплектация:

